import React, { Component } from 'react';

export class SearchGeneral extends Component {
    render() {
        return (
            <React.Fragment>
                <div className="search__container">

                    <div className="search-wrapper">

                        General search
                    </div>

                </div>
            </React.Fragment>
        );
    }
}
